import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class App extends React.Component{
    render() {
        return (
            <Router>
                <div className="container">
                    <nav>
                        <h2>Dev Corner</h2>
                        <Link to="/">Home</Link>
                        <Link to="/languages">Coding-Languages</Link>
                        <Link to="/cssframeworks">CSS-Frameworks</Link>
                        <Link to="/databases">Databases</Link>
                        <Link to="/hosting">Languages</Link>
                    </nav>
                    <Switch>
                        <Route exact path="/">
                            <Main/>
                        </Route>
                        <Route path="/historic">
                            <h1>Historic Savannah</h1>
                            <Display key="name" zip="31401"/>
                        </Route>
                        <Route path="/search">
                            <Search/>
                        </Route>
                    </Switch>
                </div>

            </Router>
        )
    }
}

export default App;
